import React from "react";

function ProgressBar(props) {
  const { timerState, progressPercent } = props;
  if (!timerState.stop) {
    return (
      <div
        className="progress-bar"
        role="progressbar"
        aria-valuemin="0"
        aria-valuemax="100"
        aria-valuenow={progressPercent}
        style={{ width: `${progressPercent}%` }}
      />
    );
  } else {
    return null;
  }
}

export default ProgressBar;
